import React, { useState, FormEvent, useCallback } from 'react';
import { PublicKey } from '@solana/web3.js';
import { transferFunds } from '../utils/transferUtils';
import { signWithWebAuthnAndCreateInstruction } from '../utils/webauthnSigningUtils';

type TransferFormProps = {
  publicKey: PublicKey | null;
  balance: number;
  onTransferComplete: (hash: string) => void;
};

export const TransferForm: React.FC<TransferFormProps> = ({ 
  publicKey, 
  balance,
  onTransferComplete
}) => {
  const [recipient, setRecipient] = useState('');
  const [amount, setAmount] = useState('');
  const [useSignature, setUseSignature] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [isSigningWithWebAuthn, setIsSigningWithWebAuthn] = useState(false);

  const validateForm = useCallback(() => {
    if (!recipient) {
      setError('Vui lòng nhập địa chỉ người nhận');
      return false;
    }

    let recipientKey: PublicKey;
    try {
      recipientKey = new PublicKey(recipient);
    } catch (err) {
      setError('Địa chỉ người nhận không hợp lệ');
      return false;
    }

    const amountValue = parseFloat(amount);
    if (isNaN(amountValue) || amountValue <= 0) {
      setError('Số lượng SOL không hợp lệ');
      return false;
    }

    if (amountValue > (balance || 0)) {
      setError('Số dư không đủ');
      return false;
    }

    return true;
  }, [recipient, amount, balance]);

  const handleSubmit = async (e: FormEvent) => {
    e.preventDefault();
    setError(null);

    if (!publicKey) {
      setError('Vui lòng kết nối ví trước khi chuyển tiền');
      return;
    }

    if (!validateForm()) {
      return;
    }

    setIsLoading(true);

    try {
      let signatureInstruction = undefined;

      if (useSignature) {
        try {
          setIsSigningWithWebAuthn(true);

          // Cấu tạo thông điệp để ký
          const message = `Xác nhận chuyển ${amount} SOL đến ${recipient}`;

          // Địa chỉ của chương trình xác minh chữ ký secp256r1 trên Solana
          const programId = new PublicKey('SECP256r1VeriFy1111111111111111111111111');

          // Ký bằng WebAuthn và tạo instruction
          signatureInstruction = await signWithWebAuthnAndCreateInstruction(
            message,
            programId
          );

          setIsSigningWithWebAuthn(false);
        } catch (signError: any) {
          setIsSigningWithWebAuthn(false);
          setError(`Lỗi ký giao dịch: ${signError.message}`);
          setIsLoading(false);
          return;
        }
      }

      // Gửi giao dịch với hoặc không có instruction chữ ký
      const transactionHash = await transferFunds(
        publicKey,
        new PublicKey(recipient),
        parseFloat(amount),
        signatureInstruction
      );

      onTransferComplete(transactionHash);

      // Reset form
      setRecipient('');
      setAmount('');
      setUseSignature(false);
    } catch (err: any) {
      console.error('Lỗi khi chuyển tiền:', err);
      setError(`Lỗi khi chuyển tiền: ${err.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="transfer-form">
      <h2>Chuyển SOL</h2>
      {error && <div className="error">{error}</div>}
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="recipient">Địa chỉ người nhận:</label>
          <input
            id="recipient"
            type="text"
            value={recipient}
            onChange={(e) => setRecipient(e.target.value)}
            disabled={isLoading || isSigningWithWebAuthn}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="amount">Số lượng SOL:</label>
          <input
            id="amount"
            type="number"
            step="any"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            disabled={isLoading || isSigningWithWebAuthn}
            required
          />
        </div>
        <div className="form-group checkbox">
          <input
            id="useSignature"
            type="checkbox"
            checked={useSignature}
            onChange={(e) => setUseSignature(e.target.checked)}
            disabled={isLoading || isSigningWithWebAuthn}
          />
          <label htmlFor="useSignature">
            Ký giao dịch này bằng WebAuthn (xác thực sinh trắc học)
          </label>
        </div>
        <button 
          type="submit" 
          disabled={!publicKey || isLoading || isSigningWithWebAuthn}
        >
          {isLoading 
            ? 'Đang xử lý...' 
            : isSigningWithWebAuthn 
              ? 'Đang chờ xác thực...' 
              : 'Chuyển tiền'}
        </button>
      </form>
    </div>
  );
};
